import React from 'react';
import logo from './res/muez_logo.png';
import Router from "./components/Router";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Coming Soon
        </p>
        <Router>

        </Router>
      </header>
    </div>
  );
}

export default App;
